          {data.map((content) => (
            <Content
              key={content.id}
              item={content}
              deleteContent={deleteContent}
              editContent={editContent}
              checkContent={checkContent}
              uncheckContent={uncheckContent}
            />
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ListContent;
